package com.scanchex.bo;


public class SCServiceComponentInfo {

	
	public String itemId;
	public String compId;
	public String compDescription;
	public String compCost;
	public String compNotes;
	public String compQuantity;
	public SCServiceComponentInfo() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getItemId() {
		return itemId;
	}
	public void setItemId(String itemId) {
		this.itemId = itemId;
	}
	public String getCompId() {
		return compId;
	}
	public void setCompId(String compId) {
		this.compId = compId;
	}
	public String getCompDescription() {
		return compDescription;
	}
	public void setCompDescription(String compDescription) {
		this.compDescription = compDescription;
	}
	public String getCompCost() {
		return compCost;
	}
	public void setCompCost(String compCost) {
		this.compCost = compCost;
	}
	public String getCompNotes() {
		return compNotes;
	}
	public void setCompNotes(String compNotes) {
		this.compNotes = compNotes;
	}
	public String getCompQuantity() {
		return compQuantity;
	}
	public void setCompQuantity(String compQuantity) {
		this.compQuantity = compQuantity;
	}
	
	
	
}
